    private static double testShouyi(List<String> jsonArray, double sumLevel, double xishuA, double xishuB, boolean inputNeedLog) {
        List<OneData> list = new ArrayList<>(jsonArray.size());
        List<Double> shouyi = new ArrayList<>();
        jsonArray.forEach(e -> {
            String arr[] = e.split(",");
            OneData oneData = new OneData();
            oneData.date = arr[0];
            oneData.start = Double.parseDouble(arr[1]);
            oneData.end = Double.parseDouble(arr[2]);
            oneData.startEndDiff = (oneData.end - oneData.start) / oneData.start * 100;
            if (list.size() != 0) {
                OneData lastOneData = list.get(list.size() - 1);
                oneData.last2StartDiff = (oneData.start - lastOneData.end) / lastOneData.end * 100;
                oneData.last2EndDiff = (oneData.end - lastOneData.end) / lastOneData.end * 100;
                if (list.size() > 1) {
                    double sum = lastOneData.last2EndDiff * xishuA + lastOneData.last2StartDiff * xishuB; //
                    String color = ANSI_RESET;
                    boolean needLog = true;
                    if (sum > sumLevel) { //
                        needLog = true;
                        color = oneData.last2EndDiff > 0 ? ANSI_GREEN : ANSI_RED;
                        shouyi.add(oneData.last2EndDiff);
                    }
                    if (needLog && inputNeedLog) {
                        System.out.println(color + String.format("\t日期：%s  \t上日开涨：%.2f  \t上日收涨：%.2f  \t上日波动：%.2f  \t开比上收：%.2f  \t当日收涨：%.2f  \t指数：%.2f ",
                                oneData.date,
                                lastOneData.last2StartDiff,
                                lastOneData.last2EndDiff,
                                lastOneData.startEndDiff,
                                Math.abs(oneData.last2StartDiff / lastOneData.last2EndDiff),
                                oneData.last2EndDiff,
                                sum
//                            oneData.last2EndDiff
                        ) + ANSI_RESET);
                    }
                }
            }
            list.add(oneData);
        });
        double shouyiSum = 1.0;
        for (double sy : shouyi) {
            shouyiSum *= (1 + sy / 100.0 - 0.001);
        }
        shouyiSum -= 1;
        if (inputNeedLog) {
            System.out.printf("累积%d次，累计收益:%.2f,平均收益：%.2f\n", shouyi.size(), shouyiSum, shouyiSum / shouyi.size() * 100);
        }
        return shouyiSum;
    }

    @Data
    public static class Shouyi {
        String date;
        double lastZhiShu;
        double todayShouyi;//百分比
    }

    private static List<Shouyi> daPan(List<String> jsonArray, double xishuA, double xishuB) {
        List<OneData> list = new ArrayList<>(jsonArray.size());
        List<Shouyi> shouyiList = new ArrayList<>();
        jsonArray.forEach(e -> {
            String arr[] = e.split(",");
            OneData oneData = new OneData();
            oneData.date = arr[0];
            oneData.start = Double.parseDouble(arr[1]);
            oneData.end = Double.parseDouble(arr[2]);
            oneData.startEndDiff = (oneData.end - oneData.start) / oneData.start * 100;
            Shouyi retShouyi = new Shouyi();
            if (list.size() != 0) {
                OneData lastOneData = list.get(list.size() - 1);
                oneData.last2StartDiff = (oneData.start - lastOneData.end) / lastOneData.end * 100;
                oneData.last2EndDiff = (oneData.end - lastOneData.end) / lastOneData.end * 100;
                if (list.size() > 1) {
                    double sum = lastOneData.last2EndDiff * xishuA + lastOneData.last2StartDiff * xishuB; //
                    retShouyi.todayShouyi = oneData.last2StartDiff;
                    retShouyi.lastZhiShu = sum;
                    retShouyi.date = oneData.date;
                }
            }
            list.add(oneData);//jisuan
            shouyiList.add(retShouyi);
        });
        return shouyiList;
    }


